// the function shows the results of a simulation
function showResults(source) {
	var sourceEconomy = {
		name: countries[source],
		loss: Number((losses[source]*100).toFixed(4))
	};
	var otherEconomies = [];
	
	for(var i = 0; i < n; i++) {
		if (i != source) {
			var economy = {
				name: countries[i],
				loss: Number((losses[i]*100).toFixed(4))
			};
			otherEconomies.push(economy);
		}
	}
	
	otherEconomies.sort((a, b) => parseFloat(b.loss) - parseFloat(a.loss));
	
	var result = document.getElementById("result");
	var html = "";
	//html += "<tr><th>Countries</th><th>Reduction in GDP due to global recession</th></tr>";
	
	html += "<tr><td colspan=2  class='mdl-typography--text-center'><strong>Source economy</strong></td>";
	html += "<tr><td class='mdl-data-table__cell--non-numeric'><strong>"+sourceEconomy.name+"</strong></td>";
	html += "<td>"+sourceEconomy.loss+"%</td>";
	html += "</tr>";
	html += "<tr><td colspan=2 class='mdl-typography--text-center'><strong>Other economies</strong></td>";
	

	for(var i = 0; i < n - 1; i++) {
		html += "<tr><td class='mdl-data-table__cell--non-numeric'><strong>"+otherEconomies[i].name+"</strong></td>";
		html += "<td>"+otherEconomies[i].loss+"%</td>";
		html += "</tr>";
	}
	
	result.innerHTML = html;
		
	var labels = [];
	var data = [];
	for(var i = 0; i < n; i++) {
		var economy = mapCountries.find((d) => d.id == mapIDs[i]);
		var loss = losses[i];
		
		var nation = {
			value: loss*100,
			feature: economy
		};

		data.push(nation);
		labels.push(economy.properties.name);
	}
	
	myMap.data.labels = labels;
	myMap.data.datasets[0].data = data;
	
	myMap.color = 'rgba(0,0,0,1)';	
	myMap.update();	

}


